@joeybtoonz I talked to a few 18 year olds on LI recently and asked what they did for fun

They drive around.. bc there’s nowhere they can go. Parents won’t let kids come over ever since Covid

They showed me videos of Deer Park Ave! There’s racing and drifting now. A new generation

Best art in NYC down in the LES 🤣

Cuomo’s looking fabbbbuloussss! 

