@AntoniaRForster I've been known as "Miss Metaverse" since 2012

To me - the Metaverse meant the existence of multiple realities beyond "base reality" - virtuality, multi dimensions of reality and spirituality (a la Ervin Laszlo)

I won't let it become meaningless - because it's timeless

@NYCMayor Addiction starts by self-medicating trauma away. Over time, their brains are rewired to a perpetual state of fight or flight / survival mode

By then, they don't have the capacity to get the help they need

We must do better than "let them hit rock bottom."

